import unittest
import os
from unittest.mock import patch, MagicMock
from app import create_app
import uuid
from models.models import Product, ProductCategory

class UpdateProductTestCase(unittest.TestCase):
    def setUp(self):
        os.environ["TESTING"] = "true"
        self.app = create_app()
        self.app.testing = True
        self.client = self.app.test_client()
        self.app_context = self.app.app_context()
        self.app_context.push()
        self.valid_data = {
            "sku": "SKU123",
            "name": "Updated Product",
            "unit_value": 15.99,
            "storage_conditions": "Cool and dry",
            "product_features": "New features",
            "provider_id": str(uuid.uuid4()),
            "category": ProductCategory.LIMPIEZA.value,
            "estimated_delivery_time": "2025-06-01T10:00:00",
            "photo": "",
            "description": "Updated description"
        }

        self.product_id = str(uuid.uuid4())

    def tearDown(self):
        self.app_context.pop()

    @patch("views.update_product.db.session")
    def test_update_product_success(self, mock_db):
        product = MagicMock(spec=Product)
        mock_db.session.query().filter_by().first.return_value = product

        response = self.client.put(f"/products/{self.product_id}", json=self.valid_data)
        self.assertEqual(response.status_code, 202)
        self.assertIn("Product updated successfully", response.get_json()["message"])

    def test_invalid_product_id(self):
        response = self.client.put("/products/invalid-uuid", json=self.valid_data)
        self.assertEqual(response.status_code, 400)
        self.assertIn("Invalid product ID", response.get_json()["message"])

    @patch("views.update_product.db") 
    def test_product_not_found(self, mock_db):
        mock_query = mock_db.session.query.return_value
        mock_filter = mock_query.filter_by.return_value
        mock_filter.first.return_value = None

        response = self.client.put(f"/products/{self.product_id}", json=self.valid_data)

        self.assertEqual(response.status_code, 404)
        self.assertIn("Product not found", response.get_json()["message"])

    @patch("views.update_product.db.session")
    def test_invalid_unit_value(self, mock_db):
        data = self.valid_data.copy()
        data["unit_value"] = "not_a_float"
        product = MagicMock(spec=Product)
        mock_db.session.query().filter_by().first.return_value = product

        response = self.client.put(f"/products/{self.product_id}", json=data)
        self.assertEqual(response.status_code, 400)
        self.assertIn("unit_value must be a valid float", response.get_json()["message"])

    @patch("views.update_product.db.session")
    def test_invalid_category(self, mock_db):
        data = self.valid_data.copy()
        data["category"] = "INVALID_CATEGORY"
        product = MagicMock(spec=Product)
        mock_db.session.query().filter_by().first.return_value = product

        response = self.client.put(f"/products/{self.product_id}", json=data)
        self.assertEqual(response.status_code, 400)
        self.assertIn("Invalid category", response.get_json()["message"])

    @patch("views.update_product.db.session")
    def test_invalid_provider_uuid(self, mock_db):
        data = self.valid_data.copy()
        data["provider_id"] = "invalid-uuid"
        product = MagicMock(spec=Product)
        mock_db.session.query().filter_by().first.return_value = product

        response = self.client.put(f"/products/{self.product_id}", json=data)
        self.assertEqual(response.status_code, 400)
        self.assertIn("provider_id must be a valid UUID", response.get_json()["message"])

    @patch("views.update_product.db.session")
    def test_invalid_estimated_delivery_time_format(self, mock_db):
        data = self.valid_data.copy()
        data["estimated_delivery_time"] = "2025/06/01"
        product = MagicMock(spec=Product)
        mock_db.session.query().filter_by().first.return_value = product

        response = self.client.put(f"/products/{self.product_id}", json=data)
        self.assertEqual(response.status_code, 400)
        self.assertIn("Invalid format for 'estimated_delivery_time'", response.get_json()["message"])
